import Head from "next/head";
import {GlobalStyles} from "../components/GlobalStyles.js";

export default ({ Component, pageProps }) => {
  return (
    <>
      <Head>
        <title>CrowdMOT</title>
      </Head>
      <GlobalStyles>
        <Component {...pageProps} />
      </GlobalStyles>
    </>
  );
};
